import "../Css/MapMarker.css"
import "../Css/Modal.css"

class SurfSpot extends Component {
    constructor(props) {
        super(props);

        this.state = {
            weather: []
        }; 
    }

    render() {

    return(
        <div>
            <div className="MapMarker">
                <h1>{this.props.name}</h1>
                <button className="open-modal-btn" onClick={this.props.open_modal}>Open Modal</button>

            </div>
        </div>
        )
    }
}

export default SurfSpot;
